import React from 'react';


function Home() {
  return (
    <>
      <section id="header"  className=''>
        <div  className="container-fluid nav-bg">
          <div className="row">
            <div className='col-10 mx-auto'>
              <div className='col-md-6 pt-5 pt-lg-0 order-2 order-lg-1'>
                <h1>Grow your skill with <strong>iHub Talent</strong></h1>
                <h2 className='my-3'>
                  We are the team of talented teachers
                </h2>
              </div>
            </div>
          </div>
        </div>
      </section>
    </>
  );
}

export default Home;
